async function getGists() {
    await pm.sendRequest('https://api.github.com/gists', (err, res) => {
        console.log('res: ', res.json())
        if (err) {
            console.log(err);
        } else {
            pm.globals.set("GISTS", JSON.stringify(res.json()));
        }
    });
}
